import React, { useEffect, useState } from "react";
const ListComp = () => {
  const [Apidata, setData] = useState();

  const fetchApi = async (url) => {
    try {
      const response = await fetch(url);
      const data = await response.json();
      setData(data);
    } catch (error) {
      console.log(error);
    }
  };
  //   function fetchApi(url) {
  //     fetch(url)
  //       .then((data) => {
  //         console.log(data);
  //         return data.json();
  //       })
  //       .then((item) => {
  //         console.log(item);
  //       });
  //   }
  useEffect(() => {
    let url = "https://api.minebrat.com/api/v1/states";
    fetchApi(url);
  }, []);
  return (
    <>
      <h1>Hello</h1>
      <ul>
        {Apidata.map(({ stateId, stateName, city }) => {
          return (
            <li key={stateId}>
              <h1>{stateId}</h1>
              <h1>{stateName}</h1>
              <h1>{city}</h1>
            </li>
          );
        })}
      </ul>
    </>
  );
};
export default ListComp;
